/* post接口 */
router.post('/api/qinglongMessage', async (req, res) => {
  try {
    const setToken = await db.get('qinglongNotifyAPI_token', null);
    if (!setToken) {
      return res.send({ code: 401, data: '', msg: '未设置token，拒绝访问' });
    }

    const { title, message, token } = req?.body;
    if (token !== setToken) {
      return res.send({ code: 400, data: '', msg: '青龙BncrToken与Bncr setToken不一致' });
    }

    /* 标题 */
    // console.log('title', title);
    /* 推送日志 */
    // console.log('message', message);

    // 入口
    main(title, message);

    /* 返回结果 */
    return res.send({ code: 200, data: '', msg: 'ok' });
  } catch (e) {
    res.send({ code: 400, data: '', msg: '参数有误！' });
    log.error(e.message);
  }
});

/* get接口 */
router.get('/api/qinglongMessage', async (req, res) => {
  res.send('Bncr青龙消息通知接口');
});

